export default class AppBar extends React.Component {
        render(){

            const Menu = props => (
                <div id="appBar">
                    <a  >Ir a aprenderaprogramar.com</a>

                    <h2 id="titulo" onClick={this.handleClick}  >Wdemy </h2> 
                </div>
            )
            return (
                <>
                <div id="menu">
                    <Menu />
                </div>
                </>
            )
        }

}
